func isPrintable(targetGrid [][]int) bool {
	vs := make(map[int]bool)
	vss := make(map[int]map[int]bool)

	mL, mR, mT, mB := make([]int, 66), make([]int, 66), make([]int, 66), make([]int, 66)
	for i := 0; i <= 65; i++ {
		mL[i], mT[i] = len(targetGrid[0]), len(targetGrid)
	}

	for i, _ := range targetGrid {
		for j, v := range targetGrid[i] {
			if _, ok := vs[v]; !ok {
				vs[v] = true
			}
			if j < mL[v] {
				mL[v] = j
			}
			if j > mR[v] {
				mR[v] = j
			}
			if i < mT[v] {
				mT[v] = i
			}
			if i > mB[v] {
				mB[v] = i
			}
		}
	}
	for k, _ := range vs {
		for ii := mT[k]; ii <= mB[k]; ii++ {
			for jj := mL[k]; jj <= mR[k]; jj++ {
				if targetGrid[ii][jj] != k {
					if _, ok := vss[k]; !ok {
						vss[k] = map[int]bool{}
					}
					vss[k][targetGrid[ii][jj]] = true
				}
			}
		}
	}

	//
	mm := make(map[int]int)
	for k, _ := range vs {
		mm[k] = 0
	}
	for k, _ := range vss {
		for vv, _ := range vss[k] {
			mm[vv]++
		}
	}
	done := false
	for {
		for k, v := range mm {
			if v <= 0 {
				for kk, _ := range vss[k] {
					mm[kk]--
				}
				delete(mm, k)
				done = true
			}
		}
		if !done {
			return false
		}
		if len(mm) == 0 {
			return true
		}
		done = false
	}
}
